import React from "react";
import Recipe from "./Recipe";

export default function RecipeList() {
  return (
    <div>
      <Recipe />
    </div>
  );

  const data = [
    {
      id: 1,
      cookTime: "1:45",
      servings: 3,
      Instructions:
        "Instructions: \n1.Put salt on Chicken \n2. Put Chicken in oven \n3. Eat Chicken",
    },
  ];
}
